package com.rongke.enums;/** * Created by bilibili on 2017/11/27. */public enum DictdataNameEnum {    ASSESSMONEY("评估费","assessMoney"),    CASHPLEDGE("押金比例","cashPledge"),    RENTDAYMONEY("日租金","rentDayMoney"),    DECREASEDAY("日租金递减触发时间","decreaseDay"),    DECREASEPROPORTION("日租金递减比例","decreaseproPortion"),    LEASTRENTDAYMONEY("最低日租金","leastRentDayMoney"),    OVERTIMEDAY("超时费触发条件(*连续欠租(天))","overtimeDay"),    PUNISHMENTOVERTIMEDAY("惩罚性超时费触发(欠租天数)","punishmentOvertimeDay"),    OVERTIMEMONEY("超时费费用","overtimeMoney"),    PUNISHMENTOVERTIMEMONEY("惩罚性超时费费用","punishmentOvertimeMoney"),    VESIONS("app版本","vesions"),    APPLINKURL("app下载地址","appLinkUrl"),    TONGDUNSOCRE("同盾分数","tongDunScore"),    SFMAXAGE("身份认证最大年龄","personalAge"),    ;    private String type;    private String typeName;    DictdataNameEnum(String type, String typeName) {        this.type = type;        this.typeName = typeName;    }    /**     * 根据type 获取typeName     * @param type     * @return     */    public static DictdataNameEnum getUserTypeByType(String type) {        for (DictdataNameEnum userTypeEnum: values()) {            if (userTypeEnum.getType().equals(type)) {                return userTypeEnum;            }        }        return null;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }    public String getTypeName() {        return typeName;    }    public void setTypeName(String typeName) {        this.typeName = typeName;    }}